import React from "react";
import { Link } from "react-router-dom";

const Public = () => {
  const content = (
    <section className="public">
      <header>
        <h1>
          Welcome to <span className="nowrap">Dan D. Repairs</span>
        </h1>
      </header>
      <main className="public__main">
        <p>
          Titans follows young heroes from across the DC Universe as they come
          of age and find belonging in a gritty take on the classic Teen Titans
          franchise. Dick Grayson and
        </p>
        <address className="public__addr">
          Dan D. Repairs <br />
          555 Foo Drive <br />
          Foo City, CA 12345 <br />
          <a href="tell:+55555555555555">(555) 555-5555</a>
        </address>
        <br />
        <p>Owner:Dan Davidson</p>
      </main>
      <footer>
        <Link to="/login">Employee Login</Link>
      </footer>
    </section>
  );
  return content;
};

export default Public;
